INSERT INTO `page` (`page_id`, `path`, `template`, `title`, `subtitle`, `content`, `json_content`, `page_type_id`, `user_id`, `visibility`, `categorie_id`, `subcategorie_id`, `status`, `layout`, `mainImage`, `thumbnailImage`, `date_publish`, `date_update`, `date_create`, `date_delete`) VALUES
	(100, 'blade-templates', 'default', 'Blade Templates', '', '<!-- wp:paragraph -->\n<p>Blade is the simple, yet powerful templating engine provided with Laravel. Unlike other popular PHP templating engines, Blade does not restrict you from using plain PHP code in your views. In fact, all Blade views are compiled into plain PHP code and cached until they are modified, meaning Blade adds essentially zero overhead to your application. Blade view files use the&nbsp;<code>.blade.php</code>&nbsp;file extension and are typically stored in the&nbsp;<code>resources/views</code>&nbsp;directory.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', NULL, 1, 1, 1, 0, 0, 0, 'default', NULL, NULL, '2020-11-26 20:46:24', '2020-11-16 13:55:53', '2020-11-26 20:46:24', '2020-11-27 02:03:51'),
	(102, 'typescript-the-best-resources-to-learn-it', 'default', 'TypeScript: The Best Resources to Learn It', '', '<!-- wp:paragraph -->\n<p>If you are interested in learning&nbsp;<a href="https://javarevisited.blogspot.com/2018/07/top-5-courses-to-learn-typescript.html">TypeScript&nbsp;</a>or&nbsp;<a href="http://www.java67.com/2018/01/top-5-free-angular-js-online-courses-for-web-developers.html">Angular</a>, one of the popular JavaScript frameworks for developing front-end, which uses TypeScript and looking for some resources like books, tutorials and courses then you have come to the right place.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In this article, I am going to share some of the&nbsp;<strong>best, free TypeScript online courses</strong>&nbsp;you can use to learn this powerful programming language.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For those who don’t know TypeScript, it’s a new dynamically typed programming language from Microsoft which augments&nbsp;<a href="http://www.java67.com/2018/04/top-5-free-javascript-courses-to-learn.html">JavaScript’s</a>&nbsp;programming syntax by adding some new features which help in object-oriented application development, particularly introduction of Types.<br><br>As the name suggests,&nbsp;<strong>TypeScript</strong>&nbsp;is a combination of Types and&nbsp;<a href="https://medium.com/javarevisited/my-favorite-free-tutorials-and-courses-to-learn-javascript-8f4d0a71faf2">JavaScript</a>, which means now you have proper variables in your code like a String or Integer variable and fewer type-safety related bugs to worry.<br><br>The good thing about TypeScript is that it compiles into native&nbsp;<a href="http://www.java67.com/2017/07/6-ways-to-redirect-web-page-using-JavaScript-and-jQuery.html">JavaScript code</a>&nbsp;which can run on a browser, which means you now have a better syntax to write code and you can also take advantage of the ubiquitousness of JavaScript.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {"ordered":true} -->\n<ol><li>Introduction to&nbsp;<strong>TypeScript</strong>. ...</li><li><strong>Typescript</strong>&nbsp;Fundamentals. ...</li><li>Getting Started with&nbsp;<strong>TypeScript</strong>. ...</li><li><strong>TypeScript</strong>&nbsp;Fast Crash Course. ...</li><li><strong>TypeScript</strong>&nbsp;Design Patterns. ...</li><li><strong>TypeScript</strong>, Quick and Easy. ...</li><li><strong>Typescript</strong>&nbsp;with modern React (i.e. hooks, context, suspense) ...</li><li>The Complete&nbsp;<strong>TypeScript</strong>&nbsp;For Beginners.</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', NULL, 1, 1, 1, 0, 0, 2, 'default', 1285, NULL, '2020-12-05 00:16:35', NULL, '2020-12-05 00:16:35', '2020-12-03 00:50:01'),
	(103, 'blog/que-nos-aporta-materialize-css-en-desarrollo-web', 'templates.sideBarTemplate', '¿Qué nos aporta Materialize CSS en Desarrollo Web?', '', '<h1>¿Qué nos aporta Materialize CSS en Desarrollo Web?</h1><p><br></p><p>Por un lado,&nbsp;las ventajas de Materialize CSS:</p><ul><li>El tiempo de desarrollo es menor, pues la mayor parte del código nos lo encontramos ya escrito.</li><li>Si no somos muy hábiles en el diseño podemos aplicar un framework CSS para conseguir una bonita estética en nuestros proyectos.</li><li><br></li></ul><p><img src="http://localhost:8000/./themes/iPortfolio/assets/img/portfolio/portfolio-2.jpg"><br></p><ul><li><br></li><li>Los diseños son más robustos y la estética final es más homogénea.<br></li><li>Materialize sólo ocupa aproximadamente unos 140 KB con su CSS, a lo que hay que añadirle 180 KB con el JS.</li></ul><p>Y, como todo tiene su lado negativo,&nbsp;algunos de sus inconvenientes:</p><ul><li>Tal vez se cuela más código del que vas a utilizar, aunque siempre podrás quitar lo que no te interese.</li><li>Si alguna vez quieres cambiar de framework su adaptación será más liosa.</li><li>El diseño que realizas no es del todo exclusivo y podrás ver, casi con seguridad, algo parecido en otros sitios.</li></ul><h2>Materialize vs otros frameworks</h2><br><ul><li>No requiere jQuery para funcionar.</li><li>Usa desde el principio recomendaciones CSS que otros frameworks aún no implementan (o que han tardado bastante tiempo en incorporar).</li><li>Al usar Material Design de Google, los usuarios están más familiarizados.</li></ul><h2>Primeros pasos con Materialize CSS</h2><p>Hemos de incluir los archivos con la hoja de estilos y el JavaScript. En caso de hacerlo mediante el CDN incluiremos un par de líneas de código en nuestra página.</p><p>Si lo hacemos con CDN tenemos la ventaja de que nos ahorra la descarga de los archivos desde nuestro servidor y la respuesta suele ser más rápida.</p><p>Para hacer un botón estilizado, usaremos una etiqueta&nbsp;a, con unas clases CSS determinadas.</p><p>Y si queremos hacer un icono, podremos usar el siguiente código:</p><p>Para algo más complejo, como por ejemplo hacer una tarjeta, podemos aplicar algunas clases CSS.</p>', '{"time":1668485381933,"blocks":[{"id":"71b-Ond43L","type":"header","data":{"text":"¿Qué nos aporta Materialize CSS en Desarrollo Web?","level":1}},{"id":"_UtAhdqik-","type":"paragraph","data":{"text":""}},{"id":"sEqIb0Hl-7","type":"paragraph","data":{"text":"Por un lado,&nbsp;las ventajas de Materialize CSS:"}},{"id":"J2GBQssKgT","type":"list","data":{"style":"unordered","items":["El tiempo de desarrollo es menor, pues la mayor parte del código nos lo encontramos ya escrito.","Si no somos muy hábiles en el diseño podemos aplicar un framework CSS para conseguir una bonita estética en nuestros proyectos.","Los diseños son más robustos y la estética final es más homogénea.","Materialize sólo ocupa aproximadamente unos 140 KB con su CSS, a lo que hay que añadirle 180 KB con el JS."]}},{"id":"lf7S-qFGWl","type":"paragraph","data":{"text":"Y, como todo tiene su lado negativo,&nbsp;algunos de sus inconvenientes:"}},{"id":"h-X2GRicCJ","type":"list","data":{"style":"unordered","items":["Tal vez se cuela más código del que vas a utilizar, aunque siempre podrás quitar lo que no te interese.","Si alguna vez quieres cambiar de framework su adaptación será más liosa.","El diseño que realizas no es del todo exclusivo y podrás ver, casi con seguridad, algo parecido en otros sitios."]}},{"id":"CGKdKOSck1","type":"header","data":{"text":"Materialize vs otros frameworks","level":2}},{"id":"mE06Lr6Jw2","type":"paragraph","data":{"text":""}},{"id":"wcDIJuYhot","type":"list","data":{"style":"unordered","items":["No requiere jQuery para funcionar.","Usa desde el principio recomendaciones CSS que otros frameworks aún no implementan (o que han tardado bastante tiempo en incorporar).","Al usar Material Design de Google, los usuarios están más familiarizados."]}},{"id":"9fN1d7-zz6","type":"header","data":{"text":"Primeros pasos con Materialize CSS","level":2}},{"id":"OZf__Nxgi3","type":"paragraph","data":{"text":"Hemos de incluir los archivos con la hoja de estilos y el JavaScript. En caso de hacerlo mediante el CDN incluiremos un par de líneas de código en nuestra página."}},{"id":"WxV6yHXokK","type":"paragraph","data":{"text":""}},{"id":"y6w7wAmoy5","type":"paragraph","data":{"text":"Si lo hacemos con CDN tenemos la ventaja de que nos ahorra la descarga de los archivos desde nuestro servidor y la respuesta suele ser más rápida."}},{"id":"6Kmi1J5c85","type":"paragraph","data":{"text":"Para hacer un botón estilizado, usaremos una etiqueta&nbsp;a, con unas clases CSS determinadas."}},{"id":"HKYbnS1p1a","type":"paragraph","data":{"text":""}},{"id":"Gcy8B26HDi","type":"paragraph","data":{"text":"Y si queremos hacer un icono, podremos usar el siguiente código:"}},{"id":"TTBdsKNMqZ","type":"paragraph","data":{"text":""}},{"id":"h8BSPH_Jq8","type":"paragraph","data":{"text":"Para algo más complejo, como por ejemplo hacer una tarjeta, podemos aplicar algunas clases CSS."}},{"id":"-sUizd2wCs","type":"paragraph","data":{"text":""}}],"version":"2.22.2"}', 2, 1, 1, 0, 0, 1, 'default', 1949, NULL, '2022-11-23 00:12:08', NULL, '2022-11-23 00:12:08', NULL),
	(104, 'blog/material-design', 'templates.sideBarTemplate', 'Material Design', 'Material Design', '<!-- wp:heading -->\n<p>Created and designed by Google, Material Design is a design language that combines the classic principles of successful design along with innovation and technology. Google\'s goal is to develop a system of design that allows for a unified user experience across all their products on any platform.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {"level":3} -->\n<h3>Principles</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {"align":"left","width":295,"height":295} -->\n<p class="wp-block-image"></p><figure class="alignleft is-resized"><img src="https://materializecss.com/images/metaphor.png" alt="" width="295" height="295"></figure><p></p>\n<!-- /wp:image -->\n\n<!-- wp:heading {"level":4} -->\n<h4>Material is the metaphor</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The metaphor of material defines the relationship between space and motion. The idea is that the technology is inspired by paper and ink and is utilized to facilitate creativity and innovation. Surfaces and edges provide familiar visual cues that allow users to quickly understand the technology beyond the physical world.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":167} -->\n<p class="wp-block-image"></p><figure class="alignleft is-resized"><img src="https://materializecss.com/images/bold.png" alt="" width="301" height="302"></figure><p></p>\n<!-- /wp:image -->\n\n<!-- wp:heading {"level":4} -->\n<h4>Bold, graphic, intentional</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Elements and components such as grids, typography, color, and imagery are not only visually pleasing, but also create a sense of hierarchy, meaning, and focus. Emphasis on different actions and components create a visual guide for users.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":168} -->\n<p class="wp-block-image"></p><figure class="alignleft is-resized"><img src="https://materializecss.com/images/motion.png" alt="" width="309" height="308"></figure><p></p>\n<!-- /wp:image -->\n\n<!-- wp:heading {"level":4} -->\n<h4>Motion provides meaning</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Motion allows the user to draw a parallel between what they see on the screen and in real life. By providing both feedback and familiarity, this allows the user to fully immerse him or herself into unfamiliar technology. Motion contains consistency and continuity in addition to giving users additional subconscious information about objects and transformations.&nbsp;</p>\n<!-- /wp:paragraph -->', 'null', 2, 1, 1, 0, 0, 1, 'default', 1950, NULL, '2022-11-23 03:08:12', NULL, '2022-11-23 03:08:12', NULL),
	(105, 'blog/codeigniter', 'templates.sideBarTemplate', 'CodeIgniter', '', '<p>CodeIgniter is loosely based on the popular model–view–controller (<strong>MVC</strong>) development pattern. While controller classes are a necessary part of development under CodeIgniter, models and views are optional.&nbsp;</p><p>&nbsp;CodeIgniter can be also modified to use Hierarchical Model View Controller (<strong style="">HMVC</strong>) which allows the developers to maintain modular grouping of Controller, Models and View arranged in a sub-directory format.</p>', '{"time":1668643247027,"blocks":[{"id":"9CUfaZBH4g","type":"paragraph","data":{"text":"CodeIgniter is loosely based on the popular model–view–controller (MVC) development pattern. While controller classes are a necessary part of development under CodeIgniter, models and views are optional. CodeIgniter can be also modified to use Hierarchical Model View Controller (HMVC) which allows the developers to maintain modular grouping of Controller, Models and View arranged in a sub-directory format."}}],"version":"2.22.2"}', 2, 1, 1, 0, 0, 1, 'default', 1289, NULL, '2022-11-23 00:37:28', NULL, '2022-11-23 00:37:28', NULL),
