	(122, 'bootstrap', 'default', 'Bootstrap', '', '<!-- wp:paragraph -->\n<p><strong>Bootstrap</strong>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Free_and_open-source">free and open-source</a>&nbsp;<a href="https://en.wikipedia.org/wiki/CSS_framework">CSS framework</a>&nbsp;directed at responsive,&nbsp;<a href="https://en.wikipedia.org/wiki/Responsive_web_design#Mobile_first,_unobtrusive_JavaScript,_and_progressive_enhancement">mobile-first</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Front-end_web_development">front-end web development</a>. It contains&nbsp;<a href="https://en.wikipedia.org/wiki/CSS">CSS</a>- and (optionally)&nbsp;<a href="https://en.wikipedia.org/wiki/JavaScript">JavaScript</a>-based design templates for&nbsp;<a href="https://en.wikipedia.org/wiki/Web_design#Typography">typography</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Form_(HTML)">forms</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Button_(computing)#HTML">buttons</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Web_navigation#Local_website_navigation">navigation</a>, and other interface components.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {"id":1} -->\n<figure class="wp-block-image"><img src="http://localhost:8000//./uploads/bootstrap-illustration.jpg" class="wp-image-1"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Bootstrap is the seventh-most-starred project on&nbsp;<a href="https://en.wikipedia.org/wiki/GitHub">GitHub</a>, with more than 142,000 stars, behind&nbsp;<a href="https://en.wikipedia.org/wiki/FreeCodeCamp">freeCodeCamp</a>&nbsp;(almost 312,000 stars) and marginally behind&nbsp;<a href="https://en.wikipedia.org/wiki/Vue.js">Vue.js</a>&nbsp;framework.</p>\n<!-- /wp:paragraph -->', NULL, 1, 1, 1, 0, 0, 2, 'default', 1344, NULL, '2020-12-05 22:41:02', NULL, '2020-12-05 22:41:02', NULL),
