	(48, 103, 'meta', '[{"name":"author","content":"Gervis Mora"},{"name":"keywords","content":"\\u00bfQu\\u00e9 nos aporta Materialize CSS en Desarrollo Web?"},{"name":"description","content":"Comenzamos a\\u00f1o en este blog analizando un recurso para desarrolladores web que est\\u00e1 dando mucho de qu\\u00e9 hablar: Materialize CSS. Concebido especialmente para proyectos que hagan del  Material Design su bandera, este framework CSS nos permite ahorrar mucho tiempo y esfuerzo al implementar y optimizar nuestros proyectos web. No s\\u00f3lo contiene multitud de clases CSS ya configuradas, adem\\u00e1s incorpora c\\u00f3digo JavaScript para a\\u00f1adir a nuestras interfaces. "},{"name":"ROBOTS","content":"NOODP"},{"name":"GOOGLEBOT","content":"INDEX, FOLLOW"},{"property":"og:title","content":"\\u00bfQu\\u00e9 nos aporta Materialize CSS en Desarrollo Web?"},{"property":"og:description","content":"Comenzamos a\\u00f1o en este blog analizando un recurso para desarrolladores web que est\\u00e1 dando mucho de qu\\u00e9 hablar: Materialize CSS. Concebido especialmente para proyectos que hagan del  Material Design su bandera, este framework CSS nos permite ahorrar mucho tiempo y esfuerzo al implementar y optimizar nuestros proyectos web. No s\\u00f3lo contiene multitud de clases CSS ya configuradas,  adem\\u00e1s incorpora c\\u00f3digo JavaScript para a\\u00f1adir a nuestras interfaces. "},{"property":"og:site_name","content":"Modern Business"},{"property":"og:url","content":"http:\\/\\/localhost:8000\\/que-nos-aporta-materialize-css-en-desarrollo-web"},{"property":"og:image","content":".\\/uploads\\/diciembre-2018-materialize-2022-11-22-180124.jpg"},{"property":"og:type","content":"article"},{"property":"twitter:card","content":"summary"},{"property":"twitter:title","content":"\\u00bfQu\\u00e9 nos aporta Materialize CSS en Desarrollo Web?"},{"property":"twitter:description","content":"Comenzamos a\\u00f1o en este blog analizando un recurso para desarrolladores web que est\\u00e1 dando mucho de qu\\u00e9 hablar: Materialize CSS. Concebido especialmente para proyectos que hagan del  Material Design su bandera, este framework CSS nos permite ahorrar mucho tiempo y esfuerzo al implementar y optimizar nuestros proyectos web. No s\\u00f3lo contiene multitud de clases CSS ya configuradas,  adem\\u00e1s incorpora c\\u00f3digo JavaScript para a\\u00f1adir a nuestras interfaces. "},{"property":"twitter:image","content":".\\/uploads\\/diciembre-2018-materialize-2022-11-22-180124.jpg"}]', 1, '2020-11-26 16:41:00', '2022-11-22 17:01:39', NULL),
