	(50, 104, 'meta', '[{"name":"author","content":"Gervis Mora"},{"name":"keywords","content":"Material Design"},{"name":"description","content":"\\nCreated and designed by Google, Material Design is a design language that combines the classic principles of successful design along with innovation and technology. Google\'s goal is to develop a system of design that allows for a unified user experience across all their products on any platform.\\n\\n\\n\\nPrinciples\\n\\n\\n\\n\\n\\n\\n\\nMaterial is the metaphor\\n\\n\\n\\nThe metaphor of materia..."},{"name":"ROBOTS","content":"NOODP"},{"name":"GOOGLEBOT","content":"INDEX, FOLLOW"},{"property":"og:title","content":"Material Design"},{"property":"og:description","content":"\\nCreated and designed by Google, Material Design is a design language that combines the classic principles of successful design along with innovation and technology. Google\'s goal is to develop a system of design that allows for a unified user experience across all their products on any platform.\\n\\n\\n\\nPrinciples\\n\\n\\n\\n\\n\\n\\n\\nMaterial is the metaphor\\n\\n\\n\\nThe metaphor of materia..."},{"property":"og:site_name","content":"Modern Business"},{"property":"og:url","content":"http:\\/\\/localhost:8000\\/material-design"},{"property":"og:image","content":".\\/uploads\\/material-components-2022-11-22-223900.png"},{"property":"og:type","content":"article"},{"property":"twitter:card","content":"summary"},{"property":"twitter:title","content":"Material Design"},{"property":"twitter:description","content":"\\nCreated and designed by Google, Material Design is a design language that combines the classic principles of successful design along with innovation and technology. Google\'s goal is to develop a system of design that allows for a unified user experience across all their products on any platform.\\n\\n\\n\\nPrinciples\\n\\n\\n\\n\\n\\n\\n\\nMaterial is the metaphor\\n\\n\\n\\nThe metaphor of materia..."},{"property":"twitter:image","