	(52, 105, 'meta', '[{"name":"author","content":"Gervis Mora"},{"name":"keywords","content":"CodeIgniter"},{"name":"description","content":"CodeIgniter\\u00a0is an\\u00a0open-source software\\u00a0rapid development\\u00a0web framework, for use in building dynamic web sites with\\u00a0PHP.PopularityCodeIgniter is loosely based on the popular\\u00a0model\\u2013view\\u2013controller\\u00a0(MVC) development pattern. While controller classes are a necessary part of development under CodeIgniter, models and views are optional.\\u00a0CodeIgniter can be also modified to use Hierarchical Model View Controller (HMVC) which allows the developers to maintain modular grouping of Controller, Models and View arranged in a sub-directory format.Source code and licenseHistory"},{"name":"ROBOTS","content":"NOODP"},{"name":"GOOGLEBOT","content":"INDEX, FOLLOW"},{"property":"og:title","content":"CodeIgniter"},{"property":"og:description","content":"CodeIgniter\\u00a0is an\\u00a0open-source software\\u00a0rapid development\\u00a0web framework, for use in building dynamic web sites with\\u00a0PHP.PopularityCodeIgniter is loosely based on the popular\\u00a0model\\u2013view\\u2013controller\\u00a0(MVC) development pattern. While controller classes are a necessary part of development under CodeIgniter, models and views are optional.\\u00a0CodeIgniter can be also modified to use Hierarchical Model View Controller (HMVC) which allows the developers to maintain modular grouping of Controller, Models and View arranged in a sub-directory format.Source code and licenseHistory"},{"property":"og:site_name","content":"Modern Business"},{"property":"og:url","content":"http:\\/\\/localhost:8000\\/codeigniter"},{"property":"og:image","content":""},{"property":"og:type","content":"article"},{"property":"twitter:card","content":"summary"},{"property":"twitter:title","content":"CodeIgniter"},{"property":"twitter:description","content":"CodeIgniter\\u00a0is an\\u00a0open-source software\\u00a0rapid development\\u00a0web framework, for use in building dynamic web sites with\\u00a0PHP.PopularityCodeIgniter is loosely based on the popular\\u00a0model\\u2013view\\u2013controller\\u00a0(MVC) development pattern. While controller classes are a necessary part of development under CodeIgniter, models and views are optional.\\u00a0CodeIgniter can be also modified to use Hierarchical Model View Controller (HMVC) which allows the developers to maintain modular grouping of Controller, Models and View arranged in a sub-directory format.Source code and licenseHistory"},{"property":"twitter:image","content":""}]', 1, '2020-11-26 22:04:16', '2022-11-16 21:46:03', NULL),
