	(90, 123, 'meta', '[{"name":"author","content":""},{"name":"keywords","content":"Hire me"},{"name":"description","content":"\\n        \\n            \\n            \\n            \\n            \\n            \\n            \\n                                                \\n                \\nQuestionnaire\\nRequesting an estimate for a project only takes a few minutes of your time and costs absolutely nothing. This questionnaire was built to help me identify your needs for the project.\\n\\nAfter you click the send button, I will send you an estimate for a review. Also take a look at my Frequently Asked Questions.\\n\\n    \\n                \\n    \\n                    \\n                Your name                                            \\n                \\n            \\n                    \\n        \\n        \\n    \\n    \\n                    \\n                Your email address                                    *\\n                                            \\n                \\n            \\n                    \\n        \\n        \\n    \\n    \\n                    \\n                Your website, if you have one                                            \\n                \\n            \\n                    \\n        \\n        \\n    \\n    \\n                    \\n                Your location                                            \\n                \\n            \\n                I am based in Helsinki, Finland, but I work with clients all around the world. I only ask this to know your timezone.\\n        \\n        \\n        \\n             \\n     \\n \\nProject details\\n\\n\\n    \\n                    \\n                What can I help you with?                                            \\n                \\n            \\n                            \\n                    \\n                        \\n                        Web Design                    \\n                \\n                            \\n                    \\n                        \\n                        Web Development                    \\n                \\n                            \\n                    \\n                        \\n                        Identity Design                    \\n                \\n                            \\n                    \\n                        \\n                        Other...                    \\n                \\n                        \\n                Web Design is all about the visuals, no code. Project deliverable will be in PSD format, and you will need a developer for the site to be fully functional. This said, If you need a fully functional website from wireframing to launch, please select Web Design and Web Development. I won\'t code other designer\'s work.\\n        \\n        \\n        \\n\\n    \\n                \\n    \\n                \\n            \\n                    \\n        \\n        \\n             \\n     \\n \\n    \\n                    \\n                Is this is a new project or a redesign for an existing site \\/ brand?                                            \\n                \\n            \\n                            \\n                    \\n                        \\n                        New project                    \\n                \\n                            \\n                    \\n                        \\n                        Redesign                    \\n                \\n                        \\n                    \\n        \\n        \\n\\n    \\n                    \\n                What is the name of the project?                                            \\n                \\n            \\n                    \\n        \\n        \\n    \\n    \\n                    \\n                Redesign for\\u2026                                            \\n                \\n            \\n                    \\n        \\n        \\n    \\n    \\n                    \\n                Do you need Responsive Design  for the site?                                            \\n                \\n            \\n                            \\n                    \\n                        \\n                        Yes please                    \\n                \\n                            \\n                    \\n                        \\n                        No thanks                    \\n                \\n                            \\n                    \\n                        \\n                        Don\'t know, please tell me more about responsive sites                    \\n                \\n                        \\n                Please notice in your budget, that creating and testing responsive interfaces of the site for additional devices do require more work. You can read a short summary What is Responsive Design and why do we need it? from my FAQ.\\n        \\n        \\n        \\n\\n    \\n                    \\n                Timeline. When do you need this completed by?                                            \\n                \\n            Please choose one\\u2026\\n                                    Please choose one\\u2026\\n                                    As soon as possible\\n                                    Within 3 weeks\\n                                    Within 6 weeks\\n                                    Within 12 weeks\\n                                    When you\'re available, let me know\\n                            \\n                I generally recommend at least three weeks for most projects, to ensure that the appropriate research and creative output is the best it can be.\\n        \\n        \\n        \\n\\n    \\n                    \\n                Budget. How much are you planning to invest in the project? (USD, Including Responsive)                                            \\n                \\n            Please choose one\\u2026\\n                                    Please choose one\\u2026\\n                                    < $2500\\n                                    $2500 \\u2013 $3500\\n                                    $3500 \\u2013 $5000\\n                                    $5000 \\u2013 $7500\\n                                    $7500 \\u2013 $10,000\\n                                    $10,000 +\\n                            \\n                Design isn\'t a commodity, meaning that you will get different costs from every designer. I listen to your specific needs first, and then put together a customized estimate based on these needs. Please provide a rough idea of what you are willing to invest, keeping in mind that the more you can invest, the more I can invest in your project.  From my FAQ: How much does it cost to work with you?How is the cost of your services determined?\\n\\n        \\n        \\n        \\n\\n    \\n                    \\n                Budget. How much are you planning to invest in the project? (USD)                                            \\n                \\n            Please choose one\\u2026\\n                                    Please choose one\\u2026\\n                                    < $1500\\n                                    $1500 \\u2013 $2500\\n                                    $2500 \\u2013 $3500\\n                                    $3500 \\u2013 $5000\\n                                    $5000 \\u2013 $7500\\n                                    $7500 \\u2013 $10,000\\n                                    $10,000 +\\n                            \\n                Design isn\'t a commodity, meaning that you will get different costs from every designer. I listen to your specific needs first, and then put together a customized estimate based on these needs. Please provide a rough idea of what you are willing to invest, keeping in mind that the more you can invest, the more I can invest in your project.  From my FAQ: How much does it cost to work with you?How is the cost of your services determined?\\n\\n        \\n        \\n        \\n\\n    \\n                    \\n                Why is the site \\/ redesign \\/ project needed? Who is the audience?                                            \\n                \\n            \\n                Is it a new site for an event or business, or an existing but outdated site in need of technical or visual upgrades? Information about target group; i.e. gender, age group, country, yearly income, profession, hobbies and interests is very helpful to narrow down the ideal audience.\\n        \\n        \\n        \\n    \\n    \\n                    \\n                What are the primary objectives and goals (long term and short term) for the project?                                            \\n                \\n            \\n                Generate sales and leads? Get your business name out there to create stronger awareness for your brand? What do you want to achieve with my help?\\n        \\n        \\n        \\n    \\n    \\n                \\n    \\n                    \\n                Web Design. What are the key reasons users may have for visiting the site?                                            \\n                \\n            \\n                Are the users coming to your site to find information about your company, an event, products, contact details or other information?\\n        \\n        \\n        \\n             \\n     \\n \\n    \\n                \\n    \\n                    \\n                Web Development. Do you want the site to be static or dynamic?                                            \\n                \\n            \\n                            \\n                    \\n                        \\n                        Static HTML                    \\n                \\n                            \\n                    \\n                        \\n                        Dynamic with Content Management System                    \\n                \\n                        \\n                Static HTML sites need some knowlege with HTML language and text editors to update the site, texts, pictures etc. Dynamic CMS sites, ie. WordPress, Joomla, Drupal and so on, are much easier to use and update \\u2013 and won\'t require any HTML knowlegde. But it requires more work to develop a site for a CMS platform, so it costs more.My personal favorite is WordPress, highly customizable and ease of use for the end-users with other cool stuff.\\n        \\n        \\n        \\n\\n    \\n                    \\n                Additional details for the development                                            \\n                \\n            \\n                In example, Do you have a favorite CMS you would like to have your site built-on? An E-commerce site with multiple payment methods? Browser support? What pages do you need, an image gallery and a contact form?\\n        \\n        \\n        \\n             \\n     \\n \\n    \\n                \\n    \\n                    \\n                Identity Design. What is the exact wording to appear in the logo? E.g. McDonalds                                            \\n                \\n            \\n                    \\n        \\n        \\n    \\n    \\n                    \\n                What is the overall message you wish to portray with your brand?                                            \\n                \\n            \\n                What sould people feel when they see or think of your brand? Is it luxorius, adventurous, technical, rebellious...\\n\\n        \\n        \\n        \\n    \\n    \\n                    \\n                Where will be your logo used and seen?                                            \\n                \\n            \\n                    \\n        \\n        \\n             \\n     \\n \\n    \\n                    \\n                Please provide any additional details for the project                                            \\n                \\n            \\n                Personal preference, a list of good and bad examples, colors, overall message, competitors in your field etc.\\n        \\n        \\n        \\n    \\nA helping hand\\n    \\n                \\n    \\n                    \\n                How did you find my services?                                            \\n                \\n            \\n                    \\n        \\n        \\n    \\n    \\n                    \\n                Your favorite YouTube video?                                            \\n                \\n            \\n                    \\n        \\n        \\n             \\n     \\n \\n    \\n                    \\n                Why did you chose to contact me for this project?                                            \\n                \\n            \\n                    \\n        \\n        \\n    \\n    \\n                    \\n                And finally, making sure you\'re a human :)                                    *\\n                                            \\n                \\n            \\n                    \\n        \\n            \\n                \\n            \\n        \\n\\n        \\n        \\n        \\n\\n    This field should be left blank\\n                \\n                \\t\\n                        Send the questionnaire\\n                    \\n                    Please wait...\\n                \\n            \\n                                                \\t            \\t\\t\\n            \\t                    \\n            "},{"name":"ROBOTS","content":"NOODP"},{"name":"GOOGLEBOT","content":"INDEX, FOLLOW"},{"property":"og:title","content":"Hire me"},{"property":"og:description","content":"\\n        \\n            \\n            \\n            \\n            \\n            \\n            \\n                                                \\n            